import logo from './logo.svg';
import Aulas from './components/Aulas';
import './App.css';
import Instrumentos from './Instrumentos';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Studio da Capo
          {console.log(<instrumentos/>)}
          <Aulas />
        </p>
      </header>
    </div>
  );
}

export default App;
